column8:
●SPF31 PA++。<br>
●シミ・ソバカス・ニキビ跡などにポンポンとピンポイントカバー。乾燥を防ぎます。<br>
●ソフトフォーカス効果のあるパウダーを配合。毛穴を目立たなくさせ、自然な明るい肌を演出します。<br>
●やわらかな感触なのに、密着オイル配合で肌にぴったり密着。しっかりカバーし、化粧崩れを防ぎます。<br>
●エモリエント成分45%配合。なめらかな使用感で、潤いを長時間キープ。 <br><br>

【使用方法】<br>
ファンデーション・チークまで仕上げた後に使用します。シミ・ニキビ跡・クマ・くすみ・赤みなど、気になる部分に直接塗り、指で軽くぼかしてください。<br><br>

【ご注意】<br>
○お肌に異常があるときは、ご使用にならないでください。<br>
○刺激等、異常のあらわれた時は使用を中止して、皮膚科専門医等へのご相談をおすすめします。<br>
○使用後は必ずしっかりキャップを閉めてください。<br>
○中身が衣服につきますと落ちにくいので、中身がつかないようにご注意ください。<br>
○チップの先はティッシュ等で拭き取り、清潔に保管してください。<br>
○極端に高温または低温の所、直射日光のあたる所、湿度の高い所、水気のある所、乳幼児の手の届く場所には保管しないでください。<br><br>

【成分】<br>
パルミチン酸エチルヘキシル、セレシン、水添ポリイソブテン、ヘキサ(ヒドロキシステアリン酸/ステアリン酸/ロジン酸)ジペンタエリスリチル、トリイソステアリン酸ポリグリセリル-2、メタクリル酸メチルクロスポリマー、セスキイソステアリン酸ソルビタン、カルナウバロウ、ジメチコン、フェノキシエタノール、アルミナ、メチコン、シリカ、トコフェロール、ラウロイルグルタミン酸ジ(フィトステリル/オクチルドデシル)、スクワラン、シア脂、テトラヘキシルデカン酸アスコルビル、ホホバ種子油、マカデミアナッツ脂肪酸フィトステリル、水、BG、アルブチン、グルコシルヘスペリジン、ジパルミトイルヒドロキシプロリン、ハチミツ、ミリスチン酸オクチルドデシル、パルミチン酸レチノール、コーン油、オタネニンジンエキス、トウキ根エキス、ヨクイニンエキス、オウゴンエキス、ボタンエキス、ザクロ果皮エキス、酸化チタン、合成金雲母、酸化鉄<br><br>

【内容量】<br>
1本<br><br>

