【フィジシャンズフォーミュラ スーパーBBビューティバームコンシーラー Light/Medium SBC03の詳細】<br>
●無香料・パラベンフリー・グルテンフリーの低刺激性。<br>
●くま、むくみ、シミ、赤み、および不均一な肌のトーンをカバーします。
●SPF30。<br><br>

【使用方法】<br>
コンシーラーを肌につけ、軽くブラシや指でなじませて下さい。<br><br>

【ご注意】<br>
○お肌に異常が生じていないか注意して使用してください。<br>
○お肌に合わないときは、ご使用をおやめください。<br><br>

【成分】<br>
水、ジメチコン、トリ(カプリル酸/カプリン酸)グリセリル、酸化チタン、シクロペンタシロキサン、酸化亜鉛、グリセリン、PEG-10ジメチコン、酸化鉄、マイカ、ポリシリコーン-11、セイヨウシロヤナギ樹皮エキス、リンゴ果実エキス、ホウケイ酸(Ca/Al)、塩化Na、フェノキシエタノール、トリエトキシカプリリルシラン、ジステアルジモニウムヘクトライト、イソステアリン酸グリセリル、リン酸ヒマシ油、カプリリルグリコール、ポリヒドロキシステアリン酸、酢酸トコフェロール、PEG/PPG-18/18ジメチコン、エチルヘキシルグリセリン、シソ種子油、アスコルビン酸テトラヘキシルデシル、リゾレシチン、ヘキシレングリコール、EDTA-2Na、水酸化Na<br><br>

【内容量】<br>
